import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 My Awesome Website. All rights reserved.</p>
      <p>Follow us on <a href="#twitter">Twitter</a>, <a href="#facebook">Facebook</a>, and <a href="#instagram">Instagram</a>.</p>
    </footer>
  );
};

export default Footer;
